"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[4908],{9154:function(e){e.exports=JSON.parse('{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","slug":"winx-day-luciano-dii-souza-o-primo-dev","date":"2025-06-14","authors":["Weslley Ara\xfajo"],"tags":["BR","Online"],"content":"\\n\ud83d\udcf9 **Live (Talk):** Overcoming impostor syndrome and the challenges of existing in the market through open source.\\n\\n:::info\\nAn online event organized by [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), with a relaxed approach and held through the [**Discord**](https://discord.gg/wyrRdpGKmj) community for developers, aiming to share experiences and knowledge, especially for those who are just starting in the field.\\n:::\\n\\n{/* truncate */}\\n\\nAt this moment when many developers feel insecure about the future of the field:\\n\\n- Is my level sufficient?\\n- Should I give up if I can\'t get a job in my field?\\n- How do I gain experience if the market doesn\'t give me opportunities?\\n- After all, will Artificial Intelligence replace developers or not?\\n\\nBringing up sensitive topics like insecurity, inferiority complex, and self-sabotage, with a light at the end of the tunnel through open source initiatives, was quite challenging but very interesting.\\n\\nThis is a talk where I expose the insecurities during my journey, speaking in a tone close to what would be a heartfelt confession.\\n\\nThe intention is to connect with those participating, evolve toward learning, and perhaps inspire through my story, sharing the human side that social networks and \\"LinkedIn titles\\" don\'t show.\\n","filePath":"winx-day.mdx","mdxPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/06/14/winx-day.mdx","summary":[],"description":"\ud83d\udcf9 **Live (Talk):** Overcoming impostor syndrome and the challenges of existing in the market through open source.\\n\\n:::info\\nAn online event organized by [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), with a relaxed approach and held through the [**Discord**](https://discord.gg/wyrRdpGKmj) community for developers, aiming to share experiences and knowledge, especially for those who are just starting in the field.\\n:::","social":"./banner.png","socialPath":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/06/14/banner.png","readingTime":1,"lastModified":"2025-12-19T19:50:01.000Z","authorsData":[{"name":"Weslley Ara\xfajo","title":"Active open-source contributor, Microsoft MVP, MySQL2\'s maintainer and Poku\'s creator \u2728","url":"https://weslley.io/en/","image_url":"/img/avatar.png","socials":{"linkedin":"wellwelwel","github":"wellwelwel","instagram":"wellwelwel","youtube":"weslleyio"}}],"previousArticle":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","slug":"codecon-summit-embrace-the-hacker-way","description":"\ud83c\udf99\ufe0f **Talk:** Creating a Test Runner: What happens behind the tests?\\n\\n:::note Summary\\nThere\'s a lot of talk about testing, but what\'s it like to create a test runner from scratch?  \\nMore than that: how do you test a test runner?\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/07/19/banner.jpeg"},"nextArticle":{"title":"GitHub Brasil \u2014 Open Source Friday","slug":"github-brasil-open-source-friday","description":"\ud83d\udcf9 **Talk (Live):** Meeting [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nIn a conversation that was both technical and casual, I had the honor of kicking off the very first edition of **Open Source Friday** by [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), hosted by [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::","social":"/home/runner/work/weslley.io/weslley.io/i18n/en/talks/2025/03/14/banner.png"},"route":"talks"}')}}]);